fragment LastSaleFragment on Product {
  id
  market(currencyCode: $currencyCode) {
    statistics(market: $marketName) {
      ...LastSaleMarketStatistics
    }
  }
  variants {
    id
    market(currencyCode: $currencyCode) {
      statistics(market: $marketName) {
        ...LastSaleMarketStatistics
      }
    }
  }
}

fragment LastSaleMarketStatistics on MarketStatistics {
  lastSale {
    amount
    changePercentage
    changeValue
    sameFees
  }
}
